import React, {Fragment} from 'react'
import { Navbar, Nav, NavDropdown, FormControl, Form, Button } from 'react-bootstrap';

const NavBar = () => {
    const showPlanner = () => {
        console.log('showPlanner')
    }

    return (
    <Navbar bg="dark" expand="lg" variant="light">
    <Navbar.Toggle aria-controls="basic-navbar-nav" />
    <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
            <NavDropdown title='title' id="basic-nav-dropdown">
                <NavDropdown.Item href="/#/shoppingcart">Shopping cart</NavDropdown.Item>
                <NavDropdown.Item href="/#/orders">Your orders</NavDropdown.Item>
            </NavDropdown>
            <Nav.Link onSelect={showPlanner}>Show planner</Nav.Link>
      </Nav>
    </Navbar.Collapse>
  </Navbar>
    )
}

export default NavBar
